import { Link } from "react-router-dom";

import './Nav.css';

const Nav = () => {
  return <nav className="nav">
    <ul>
      <li className="navBtn">
        <Link  to="/">Home</Link>
      </li>
      <li className="btnNav">
        <Link  to="/listado">Tareas</Link>
      </li>
    </ul>
  </nav>
}

export default Nav;
